import { FaShoppingCart } from "react-icons/fa";

const Navbar = () => {
  return (
  <div>
      <div className="flex flex-row justify-between">
        <img src="logo.png" />
      </div>

      <div>
        <p>Home</p>

        <FaShoppingCart />

      </div>
  </div>
  );
};

export default Navbar;
